    <title>Seventh Page</title>
    <style>
        /* Basic CSS Reset */
        html, body {
            margin: 0;
            padding: 0;
            width: 100%;
            height: 100%;
            overflow: hidden; /* Prevents scrolling */
            display: flex;
            justify-content: center;
            align-items: center;
            background-color: #2389AF; 
            position: relative; /* Needed for absolute positioning */
        }

        /* Stable SVG centered */
        #stable-svg {
            width: 1400px; /* Adjust size as needed */
            height: auto;
            z-index: 2; /* Ensures it's above the clouds */
            transform: translateX(5px); /* Moves the SVG 50px to the right */
        }

        /* Styles for floating frog */
        .frog {
            position: absolute;
            width: 800px; /* Adjust size as needed */
            height: auto;
            top: 150px;
            right: 0px;
            animation: float 10s infinite linear; /* Smooth floating effect */
            z-index: 1; /* Lower z-index to stay behind the main SVG */
        }

        /* Keyframes for floating clouds */
        @keyframes float {
            0% { transform: translateX(50px); }
            50% { transform: translateY(-50px); } /* Moves cloud left and right */
            100% { transform: translateX(50px); }
        }

        /* Individual positioning */
        #cloud { bottom: 50%; right: 5%; }

        #continue-text {
            position: absolute;
            bottom: 20px;
            left: 20px;
            font-family: Arial, sans-serif;
            font-size: 12px;
            color: #333;
            z-index: 20;
        }
    </style>
</head>
